Captured prey is enclosed within the fly’s spiny legs. The asilid carries it to a suitable perch, from which it hangs by one or both front tarsi (
Fig. 4
), earning it the nickname “hanging thief. Once the prey is manipulated into a suitable position, the predator impales it with its proboscis, usually through the membranous cervix. Prey is usually held from above and behind, oriented facing the same direction as the fly. This helps the asilids to avoid the stings of aculeate Hymenoptera (
Lavigne and Holland 1969
).
